function Private({ setUserLoggedIn }){
    const HandleClick = (setUserLoggedIn)=>{
        setUserLoggedIn(false)
    }
    return(
    <>
    <h1>Private</h1>
    <button onClick={HandleClick(this.setUserLoggedIn)}>Log out</button>
    </>);
}
export default Private;
